import * as makerjs from 'makerjs';
import { getEdges, checkClockwise, getNormalPoints } from '../utils/utils';
import { ALTERNATE_WALKWAY_DIRECTION, DEFAULT_WALKWAY_DIRECTION } from '../coreConstants';

let dimensionMap;

// #region
const tslLogo = 'data:image/png;base64,';
// #endregion

function generateDimensionEndpoints(vertices, normalDistance = 2) {
    const edges = getEdges(vertices);
    const clockWise = checkClockwise(vertices);
    const direction = clockWise ? ALTERNATE_WALKWAY_DIRECTION : DEFAULT_WALKWAY_DIRECTION;

    const endPoints = [];
    for (let i = 0, len = edges.length; i < len; i += 1) {
        const p1 = edges[i][0].clone();
        const p2 = edges[i][1].clone();
        const dimensionEdge = getNormalPoints(p1, p2, normalDistance, direction);
        endPoints.push([
            [dimensionEdge[0].x, dimensionEdge[0].y],
            [dimensionEdge[1].x, dimensionEdge[1].y],
        ]);
    }

    return endPoints;
}

function quadrantOfPoint(point) {
    if (point[0] >= 0 && point[1] >= 0) {
        return 1;
    }
    else if (point[0] < 0 && point[1] >= 0) {
        return 2;
    }
    else if (point[0] < 0 && point[1] < 0) {
        return 3;
    }
    else if (point[0] >= 0 && point[1] < 0) {
        return 4;
    }
    return null;
}

function dimensionClassifier(edge) {
    const region1 = quadrantOfPoint(edge[0]);
    const region2 = quadrantOfPoint(edge[1]);
    return region1 === region2 ? [region1, null] : [region1, region2];
}

function resolveDimensionIntersection(layoutEdge) {
    let resolved = false;
    let lastEdge;
    while (!resolved) {
        lastEdge = makerjs.path.clone(layoutEdge);
        const [iRegion1, iRegion2] = dimensionClassifier([layoutEdge.origin, layoutEdge.end]);
        const possibleInteraction = [...dimensionMap[`${iRegion1}`]];

        if (iRegion2 !== null) {
            possibleInteraction.push(...dimensionMap[`${iRegion2}`]);
        }

        for (let i = 0, len = possibleInteraction.length; i < len; i += 1) {
            // check intersection and overlapping and move the dimension line
            // until there are not intersections
            // const result = makerjs.path.intersection(layoutEdge, possibleInteraction[i]);

            // if no intersection check overlapping layoutEdge withing any other dimension
            const check1 =
               makerjs.measure.isPointOnPath(layoutEdge.origin, possibleInteraction[i]);

            const check2 = makerjs.measure.isPointOnPath(layoutEdge.end, possibleInteraction[i]);

            // const overLapping =
            //     makerjs.measure.isLineOverlapping(layoutEdge, possibleInteraction[i], true);
            if (check1 || check2) {
                const [shiftedEndPoints] =
                    generateDimensionEndpoints([layoutEdge.origin, layoutEdge.end]);
                const delta = makerjs.point.subtract(shiftedEndPoints[0], layoutEdge.origin);
                makerjs.path.moveRelative(layoutEdge, delta);
                break;
            }
            resolved = true;
        }

        if (resolved
            || possibleInteraction.length === 0
            || makerjs.measure.isPathEqual(layoutEdge, lastEdge)
        ) {
            break;
        }
    }

    const [fRegion1, fRegion2] = dimensionClassifier([layoutEdge.origin, layoutEdge.end]);

    dimensionMap[`${fRegion1}`].push(layoutEdge);
    if (fRegion2 !== null) {
        dimensionMap[`${fRegion1}`].push(layoutEdge);
    }
}

function Dimension(dimensionEndPoints, modelIdx) {
    this.models = {};
    this.paths = {};
    const labelWidth = 10;

    for (let i = 0, len = dimensionEndPoints.length; i < len; i += 1) {
        const endPoints = dimensionEndPoints[i];
        const layoutEdge = new makerjs.paths.Line(endPoints);
        // resolve dimensions then create
        resolveDimensionIntersection(layoutEdge);

        const dimensionLength = makerjs.measure.pathLength(layoutEdge);

        const dimensionEdge1 = makerjs.path.clone(layoutEdge);
        const dimensionEdge2 = makerjs.path.clone(layoutEdge);

        const arrowLength = 20;
        const arrow1 = new makerjs.models.ConnectTheDots(
            false,
            [
                [0, arrowLength * 0.0125],
                [0, -arrowLength * 0.0125],
                [0, 0],
                [arrowLength * 0.05, arrowLength * 0.0125],
                [arrowLength * 0.05, -arrowLength * 0.0125],
                [0, 0],
            ],
        );
        const arrow2 = makerjs.model.mirror(arrow1, true, true);

        const arrowModel = {
            models: {
                0: arrow1,
                1: arrow2,
            },
        };

        let anchorPoint1;
        let anchorPoint2;
        let captionAnchorPoints;

        if (dimensionLength <= labelWidth) {
            const arrowExtents = makerjs.measure.modelExtents(arrow1);
            makerjs.path.alterLength(layoutEdge, arrowExtents.width, false);
            makerjs.path.alterLength(layoutEdge, arrowExtents.width, true);
            makerjs.layout.childrenOnPath(arrowModel, layoutEdge, 0, false, true, true);

            makerjs.path.alterLength(dimensionEdge1, 1.5 * arrowExtents.width, true);
            makerjs.path.alterLength(dimensionEdge1, -dimensionLength, false);

            makerjs.path.alterLength(dimensionEdge2, 1.5 * arrowExtents.width, false);
            makerjs.path.alterLength(dimensionEdge2, -dimensionLength, true);

            [captionAnchorPoints] =
                generateDimensionEndpoints([layoutEdge.origin, layoutEdge.end], 1.5);
        }
        else {
            makerjs.layout.childrenOnPath(arrowModel, layoutEdge, 0, true, true, true);
            const reduceAmount = dimensionLength - ((dimensionLength - labelWidth) / 2);
            makerjs.path.alterLength(dimensionEdge1, -reduceAmount, false);
            makerjs.path.alterLength(dimensionEdge2, -reduceAmount, true);
            captionAnchorPoints = [layoutEdge.origin, layoutEdge.end];
        }

        if (captionAnchorPoints[0][0] < captionAnchorPoints[1][0]) {
            [anchorPoint1, anchorPoint2] = captionAnchorPoints;
        }
        else {
            [anchorPoint2, anchorPoint1] = captionAnchorPoints;
        }

        makerjs.model.addCaption(
            arrowModel,
            `${dimensionLength.toFixed(1)}m`,
            anchorPoint1,
            anchorPoint2,
        );
        this.models[`arrowModelID#${modelIdx}${i}`] = arrowModel;

        this.paths[`dimensionEdge#${modelIdx}${i}_1`] = dimensionEdge1;
        this.paths[`dimensionEdge#${modelIdx}${i}_2`] = dimensionEdge2;
    }
}

function Polygon(vertices, modelIdx) {
    // makes a new Polygon Model
    this.models = {};
    this.paths = {};

    this.models.component = new makerjs.models.ConnectTheDots(true, vertices);
    const dimensionEndPoints = generateDimensionEndpoints(vertices);
    this.dimensions = dimensionEndPoints;
    this.models.dimensions = new Dimension(dimensionEndPoints, modelIdx);
}

function Circle(center, radius, modelIdx) {
    // makes a new Circle Model
    this.models = {};
    this.paths = {};
    const radialPoints = [center, [center[0] + radius, center[1]]];
    this.paths.circleModel = new makerjs.paths.Circle(radius);
    this.dimensions = [radialPoints];

    this.models.dimensions = new Dimension([radialPoints], modelIdx);
    makerjs.path.move(this.paths.circleModel, center);
}

function CreateModel(modelData, modelIdx = 1) {
    this.models = {};
    this.paths = {};
    this.dimensions = [];
    // if (modelData.type === 'Circle') {
    //     const circle = new Circle(modelData.center, modelData.radius, modelIdx);
    //     this.models[`parentModelID#${modelIdx}`] = circle;
    //     this.dimensions.push(...circle.dimensions);
    // }
    // else if (modelData.type === 'Polygon') {
    //     const polygon = new Polygon(modelData.vertices, modelIdx);
    //     this.models[`parentModelID#${modelIdx}`] = polygon;
    //     this.dimensions.push(...polygon.dimensions);
    // }

    const { children } = modelData;

    for (let i = 0; i < children.length; i += 1) {
        const childModel = new CreateModel(children[i], modelIdx + 1);
        this.models[`childModelID#${modelIdx}${i}`] = childModel;
        this.dimensions.push(...childModel.dimensions);
    }

    if (modelData.type === 'Circle') {
        const circle = new Circle(modelData.center, modelData.radius, modelIdx);
        this.models[`parentModelID#${modelIdx}`] = circle;
        this.dimensions.push(...circle.dimensions);
    }
    else if (modelData.type === 'Polygon') {
        const polygon = new Polygon(modelData.vertices, modelIdx);
        this.models[`parentModelID#${modelIdx}`] = polygon;
        this.dimensions.push(...polygon.dimensions);
    }
}

export function Create2DDesign(designData) {
    this.models = {};
    this.paths = {};
    dimensionMap = {
        1: [],
        2: [],
        3: [],
        4: [],
    };
    const modelData = new CreateModel(designData.models);
    this.models.modelData = modelData;
    // const classifiedDimensions = dimensionClassifier(modelData.dimensions, dimensionMapping);
    this.models.dimensionData = new Dimension(designData.dimensions);
    // console.log(modelData.dimensions, classifiedDimensions, dimensionMapping);
    // resolveDimensionIntersection(classifiedDimensions, dimensionMapping);
}

export function CreatePDFTemplate(designLayout) {
    // makes a information placement layout
    this.models = {};
    this.path = {};

    const templateVertices = [
        [-400, 525],
        [400, 525],
        [400, -525],
        [-400, -525],
    ];

    this.models.template = new makerjs.models.ConnectTheDots(true, templateVertices);

    // make Heading
    // const headingBoxVertices = [
    //     [-400, 500],
    //     [400, 500],
    //     [400, 350],
    //     [-400, 350],
    // ];
    // this.models.headingBox = new makerjs.models.ConnectTheDots(true, headingBoxVertices);

    // const layoutBoxVertices = [
    //     [-400, -475],
    //     [150, -475],
    //     [150, 350],
    //     [-400, 350],
    // ];
    const layoutBoxVertices = [
        [-400, -475],
        [400, -475],
        [400, 350],
        [-400, 350],
    ];
    this.models.layoutBox = new makerjs.models.ConnectTheDots(true, layoutBoxVertices);

    const mlayoutBox = makerjs.measure.modelExtents(this.models.layoutBox);
    const northDirection = new makerjs.models.ConnectTheDots(true, [
        [-0.5, 0],
        [0, 1.5],
        [0.5, 0],
        [0, 0.3],
        [-0.5, 0],
    ]);

    const letterN = new makerjs.models.ConnectTheDots(false, [
        [0, 0],
        [0, 0.8],
        [0.6, 0],
        [0.6, 0.8],
    ]);

    makerjs.model.center(letterN);
    makerjs.model.moveRelative(letterN, [0, 2.5]);
    const compassGraphics = {
        models: {
            0: northDirection,
            1: letterN,
        },
    };
    makerjs.model.scale(compassGraphics, 20);
    makerjs.model.center(compassGraphics);

    const compassDimensions = makerjs.measure.modelExtents(compassGraphics);
    makerjs.model.moveRelative(
        compassGraphics,
        [
            mlayoutBox.high[0] - 10 - (compassDimensions.width / 2),
            mlayoutBox.high[1] - 10 - (compassDimensions.height / 2),
        ],
    );

    this.models.compass = compassGraphics;

    this.models.design2D = new Create2DDesign(designLayout);

    const measurements = makerjs.measure.modelExtents(this.models.design2D);
    const layoutBoxHeight = 600;
    const layoutBoxWidth = 600;
    const scale = measurements.height > measurements.width ?
        layoutBoxHeight / measurements.height : layoutBoxWidth / measurements.width;
    makerjs.model.scale(this.models.design2D, scale);
    makerjs.model.center(this.models.design2D);
    // move the layout at the center of the layout box.
    const centerPoint = makerjs.point.average(
        mlayoutBox.low,
        mlayoutBox.high,
    );
    makerjs.model.moveRelative(this.models.design2D, centerPoint);
}

