export function generateHeader(doc) {
    doc
        .image(tslLogo, 50, 40, { width: 100, height: 40 })
        .fillColor('#444444')
        .fontSize(12)
        .text('The Solar Labs', 0, 45, { align: 'right' })
        .text('Lane No. 3, Westend Marg', 0, 60, { align: 'right' })
        .text('Saket, New Delhi. 110068.', 0, 75, { align: 'right' })
        .moveDown();
}

export function createProjectHeading(doc, projectName, designDetails) {
    doc
        .moveDown()
        .fillColor('#444444')
        .fontSize(18)
        .text(`${projectName}`, { width: 600, align: 'center' })
        .fontSize(14)
        .text(`Design Name: ${designDetails.designName}`, 40, 160, { width: 400, align: 'left' })
        .text(`Latitute: ${designDetails.geoLocation.lat.substring(0, 6)}`, 40, 190, { width: 400, align: 'left' })
        .text(`Longitude: ${designDetails.geoLocation.long.substring(0, 6)}`, 40, 205, { width: 400, align: 'left' });
}

